import React from "react";

export const Notes = ({ notes }) => {
  return (
    <ul class="list-group">
      {notes.map((note, index) => (
        <li class="list-group-item" key={note.id}>
          {note.title}}
        </li>
      ))}
    </ul>
  );
};
